const New = () => {
  const materials = {
    lea: "leather",
    cot: "cottone",
  };
  return (
    <div>
      <label>Select Material</label>
      {materials.map((mat) => (
        <select>
          <option>{mat.cot}</option>
        </select>
      ))}
    </div>
  );
};

export default New;
